SMTP_SERVER = "smtp.gmail.com"     # Change if Zoho, Outlook, SES, etc.
SMTP_PORT   = 587
SMTP_USER   = "pixelbotix@gmail.com"
SMTP_PASS   = "zzhc blci mrmb jksu"    # Must be App Password for Gmail/Zoho

SENDER_EMAIL = "pixelbotix@gmail.com"
RECEIVER_EMAIL = "eamanuf@gmail.com"
SUBJECT = "PixelBotix - 15 Day ROS & AMR Internship Program"

# -----------------------------
# YOUR BASE64 HTML HERE
# -----------------------------
html_content = """
<!DOCTYPE html>
<html>

<head>
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <style>
        img {
            display: block;
            margin-left: auto;
            margin-right: auto;
        }
    </style>
</head>

<body><img
        src="data:image/png;base64,"
        alt="15" style="max-width:100%;"></body>

</html>
"""

# -----------------------------
# BUILD EMAIL BODY
# -----------------------------
message = MIMEMultipart("alternative")
message["From"] = SENDER_EMAIL
message["To"] = RECEIVER_EMAIL
message["Subject"] = SUBJECT

message.attach(MIMEText(html_content, "html"))

# -----------------------------
# SEND EMAIL
# -----------------------------
try:
    server = smtplib.SMTP(SMTP_SERVER, SMTP_PORT)
    server.starttls()
    server.login(SMTP_USER, SMTP_PASS)
    server.sendmail(SENDER_EMAIL, RECEIVER_EMAIL, message.as_string())
    server.quit()
    print("Email Sent Successfully!")

except Exception as e:
    print("Error:", e)
